             \end {questions}           

              \section{Introduction}       

                The series, created by Jason Rothenberg, is set on a planet called Earth that has been overrun by a deadly virus. The population has scattered to various planets called "100." The remaining 100 people live on Earth, hiding from the military and the government. When a young woman named Bellamy Blake is captured by the group of people who call themselves the "Fireflies," she becomes the key to finding a cure and bringing peace to the world. However, she is a target of one of their own, a man named Clarke, who wants to use her to further his own agenda. Meanwhile, another person, named Raven, has a connection to both the Fireflies and to a person who may hold the cure. As the characters struggle to work together, they discover that they are not alone in this fight, and that there may be others like them, called the Prophets, fighting to find the same cure so that everyone on the planet can survive. 

              The first season concluded on June 9, 2019 with a total of 13 episodes. It was watched by over 10 million viewers. A second season was confirmed on March 10, 2022.  The final episode of season 1 aired on May 19,2022 with over 9 million views. Season 2 premiered in June 2023. 
              Season 3 premiered July 2024.   Season 4 premiered February 2025.    Season 5 premiered April 252023 with 13 episode. With over 8 million watched.     Season 6 is expected to premiere in 2026.


