               \chapter{Season 05: Episode 1}



                   \label{sec:01}


                             In the first episode, titled "The Passage," of Season  5, we meet our main characters, Clarke and Bellam.







                                   Clarke is an assassin for an organization called The Grounders. He is from a race called Groundmen, an offshoot of humanity that is nomadic and lives in the mountains. His people were exterminated by humans, so he has sworn revenge. 






                   Bellamy is one-hundredth of a human, or a "one-hundreth," and is also an "ardor." She is part of an underground group called Firefly, dedicated to fighting the Grounder occupation of Earth. She has an older brother named Joel, whom she hasn't seen in years. Bell is resourceful and quick to take action, but is naive and easily influenced.



                               Bell and Joel are the only survivors of what was once a village. They were hiding in an old church, where they had been hiding for months. One day, while they were there, two Ground soldiers came to search the church. While they searched the building, one soldier noticed a hatch in one wall. Bel and Jo were able to get the soldiers to leave the hatch alone, then they fled the village and made their way to Earth in hopes of finding others who were like themselves, "ards."


While they waited for rescue, Bell met a boy named Caleb, whose family had also been living in hiding. Cale was the son of two of Bell's friends, Raven and Clarke. Raven was a member of Fire Fly, as was C. Clarke was her brother. After C's father was killed by Ground forces, C and his sister were taken away by Raven's group and forced to fight. During the conflict, he was severely injured and lost his left eye. Now, after months of hiding, Bel, Jo, their son, Joel and C are all hiding together in what is now called Star City. Star is short for "Stars and Stripes," a group that opposes the grounders and has taken over the city.

                   When the two soldiers returned, it was to tell Bell that her friends had escaped. But when they entered the room, both were dead.








                                       Bell and her group decide to go to Star city to rescue her friend. Along the way, her and their group are attacked by ground soldiers. Her friend is killed, along with several of her people. At the Star, Star's leader, President Daniels, offers Bell a position in her organization, if she will join them. And so, in Star country, Clark becomes an ardent, working to kill Ground fighters and anyone who supports them or their cause. This includes her former friends and allies, including Raven. Clark's brother, however, does not want to be part  of this. So, when Clark asks him to join her, his response is "No." 

                   While Bell works to destroy the organization that killed her family, there is another organization working against them: the prophesy. These are people, usually children, that are chosen to carry a message from God to humanity. God has chosen these children to deliver a warning: that Ground is not the enemy, humans are. That the humans who are Ground are being led by an evil leader who is using them as pawns to accomplish his goals. If humans do not unite against Ground, God will destroy them all. To stop this, humanity must unite and fight Ground. There is only one person in all of Star who can help them with this mission: Caine, son to one the Bell friends. Together, with Raven as their guide, this group will infiltrate Ground and destroy their leader. Their plan is simple: they will use Raven to gain access to Ground's headquarters, kill their commander, take his place, defeat Ground in battle, rescue the President, return to their home planet, Earth and tell everyone what they have learned. All they need is C, now that he is no longer an enemy. Because of his eye, though, Ground knows who he really is, what he can do, how to defeat him. Thus, all they can hope for is that C will be able  to save himself. For now, at least, everything is going according to plan. Just as they arrive at Ground headquarters to begin their mission, something happens. Something that changes everything. Someone comes for C: a Ground fighter. Not only does he kill Cain, killing him in cold blood, not only is he able, without a struggle, to subdue the president of this country and take her place in their headquarters. No, no, nothing like that. Instead, just as C is about to execute the mission that will save the country from Ground control, someone comes in and stops him: Bell. What happens next is something that no one could have predicted. Or, perhaps, could. Maybe it is best not to know. Either way: it changes the course of everything, forever. From that moment on,